import React from 'react'
import card from './product_data'

const MainContent = () => {
  console.log(card);
  const list = card.map((item)=>
  <div className='card' key={item.id}>
    <div className='img' >
      <img src={item.thumb} />
    </div>
    <div className='detail'>
      <h2> {item.product_name}</h2>
      <p>{item.description}</p>
      <p className=''></p>
    </div>

  </div>
  );
  return(
    <div className='main'>
      {list}
    </div>
  )
} 

export default MainContent ;
